import React from "react";

const TypeIt = () => {
  return (
    <div>
      <h4 className="text-muted">
        <TypeIt
          getBeforeInit={(instance) => {
            instance
              .type("Hi , I'm behzad omidi")
              .pause(750)
              .delete(10)
              .pause(600)
              .type("developer");
            return instance;
          }}
          options={{
            loop: true,
            Speed: 200,
          }}
        ></TypeIt>
      </h4>
    </div>
  );
};

export default TypeIt;
